INSERT INTO `v1_5551998b7790215313e45c0e32816cb36787c7258d1b6444c22980c094430e85` VALUES (11, 1, 82, 10, 1, 82013, 0, "その頃わたくしは、\nスカウトをお受けしておりました。\nミサト様いわく、わたくしには保育士の\n『天賦の才』があるそうで。", 0, 1, 0);
INSERT INTO `v1_5551998b7790215313e45c0e32816cb36787c7258d1b6444c22980c094430e85` VALUES (91, "", 82, 0, 0, 82014, "", "", "", 0, "");
