INSERT INTO `v1_5551998b7790215313e45c0e32816cb36787c7258d1b6444c22980c094430e85` VALUES (11, 1, 82, 10, 1, 82025, 0, "と、不退転の決意を申し上げたら、\nミサト様、「は～い♪」と、\n二つ返事で分かってくださって。", 0, 1, 0);
